package ex;

public class Member {

	private String name;
	private String id;
	

	// getter / setter 메서드
	// 알트 쉬프트 S 후 게터세터 클릭 
	
	
	
	public Member() {
		// TODO Auto-generated constructor stub
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public String getId() {
		return id;
	}
	public void setId(String id) {
		this.id = id;
	}
	
		
	
}
